import React from 'react';
import BootstrapTable from 'react-bootstrap-table-next';
import 'react-bootstrap-table-next/dist/react-bootstrap-table2.min.css';
import './App.css';
import axios from 'axios'
//const products = [ {"id": 1,"name": "Pięty Mojżesza", "price": 234 },
// {"id": 2,"name": "Mokasyny Zagłady", "price": 63 },
// {"id": 3,"name": "Sandały Asteriksa", "price": 512 },
// {"id": 4,"name": "Croksy Dudy", "price": 3 },
// {"id": 5,"name": "Buty Kota w Butach", "price": 100 },];

let products = [];
//addProducts(20);



// Make a request for a user with a given ID
axios.get('https://localhost:44303/api/getProducts')
  .then(function (response) {
    // handle success
    console.log(response);
    products=response.data;
  });


const columns = [{
  dataField: 'productID',
  text: 'ID Produktu',
  sort: true
}, {
  dataField: 'productName',
  text: 'Nazwa Produktu',
  sort: true
}, {
  dataField: 'productPrice',
  text: 'Cena Produktu',
  sort: true
}];

const defaultSorted = [{
  dataField: 'id',
  order: 'sec'
}];

function addProducts(quantity) {
  const startId = products.length;
  for (let i = 0; i < quantity; i++) {
    const id = startId + i;
    products.push({
      id: id,
      name: 'Item name ' + id,
      price: 2100 + i
    });
  }
}



const CaptionElement = () => <h3 style={{ borderRadius: '0.25em', textAlign: 'center', color: 'black', border: '1px solid black', padding: '0.5em' }}>Produkty ale w przyszłości przychody</h3>;


export default () =>
<div ><p className="App-header"> Budżet Studenta</p>
<p className="Table"><BootstrapTable bootstrap4 caption={<CaptionElement />} keyField='id' data={products} columns={ columns } defaultSorted={ defaultSorted }/>
</p></div>
